import React from "react";
import { Row, Col, Card, CardHeader, CardBody, Badge } from "reactstrap";
import "./group-dashboard.css";

class GroupUser extends React.Component {
  render() {
    return (
      <Col lg="6">
        <Card className="user-status">
          <Row></Row>
          <Row>
            <Col lg="2">
              <div className="card-profile-image">
                <a href="#pablo" onClick={e => e.preventDefault()}>
                  <img
                    alt="..."
                    className="rounded-circle card-profile-image"
                    src={require("../assets/img/users/user01.jpg")}
                  />
                </a>
              </div>
            </Col>
            <Col lg="8">

            <Badge className="status-text"color="success" pill>پرداخت: 30000 تومان</Badge>
                    <Badge className="status-text" color="danger" pill>مصرف: 40000 تومان</Badge>
                    <Badge className="status-text" color="warning" pill>وضعیت: 10000 بدهکار</Badge>

            </Col>
          </Row>
        </Card>
      </Col>
    );
  }
}

export default GroupUser;
